R["fx__@sheogoradical"]="{['TS']=1613503587,['Key']='fx__@sheogoradical',['Houses']={[1]={['Effects']={[1]={['X']=99966,['Color']=999999,['Pitch']=0,['SizeX']=1000,['Roll']=0,['Alpha']=1,['Y']=52056,['Yaw']=0,['Contrast']=1,['EffectType']=36,['SizeY']=1,['Groups']=0,['Id']=1003,['Z']=114546,['SizeZ']=1000,},[2]={['X']=110171,['Color']=102439,['Pitch']=4.712564,['MetaData']={['title']='Notice to All Blood Drinkers',['message']='Please make sure your cup catches all the blood from the keg when you want to get a drink. I am tired of having to scrape dried blood off the floor. Thank you.\\n\\nKindly,\\n\\nYour Exarch',},['SizeX']=26.456456,['Yaw']=4.712389,['Alpha']=1,['Y']=33715,['Roll']=0,['Contrast']=1,['EffectType']=8503,['SizeY']=30,['Groups']=0,['Id']=1004,['Z']=123310,['SizeZ']=30,},[3]={['X']=112755,['Color']=102439,['Pitch']=1.570971,['MetaData']={['title']='Cultist\\'s Journal',['message']='Baliras has a plan for all of us remaining. He plans to reform the Worm Cult under his name. He thinks himself the next Mannimarco; whether I believe him is a matter of discussion. For now, I will do what I am told.\\n \\n\\nHe wants to reform under the guidance of some old Chimer artifact. As Telsad Havgahn, or something like that. A mirror that can tell the future. He thinks that will legitimize his claim that he will reunite the cult under one banner, one man. And he is sending us lackeys to do the dirty work of finding it. Apparently, it is shattered into many shards and a frame. They are strewn about around Vvardenfell.\\n\\n\\nBaliras has sent me to find the first shard. I am unsure if I should feel honored or used. But, like I said, I will do as I am told. The shard is located in the Veloth Ancestral Tomb. I feel almost guilty for raiding such a place. The Veloth are an important family in Morrowind history, you know. Something something ancestor something. I do not know.\\n\\n\\nI am in the tomb right now. It is empty, save for some skavengers. There is a lot of mushrooms here; typical for an island that makes their claim to fame out of mushrooms. I do not know how far down this place goes, but I need to go until I find the shard.\\n\\n\\nI found the shard. It is huge and very, very red. I wonder if that is intentional. But it is unstable as it is now - it reeks of raw magicka. I need to conduct some sort of ritual, make it more stable to touch. The mirror cannot do the future-telling thing without it being whole, so it is important I get this back to Baliras.\\n\\n',},['SizeX']=26.456456,['Yaw']=5.410521,['Alpha']=1,['Y']=71109,['Roll']=0,['Contrast']=1,['EffectType']=8501,['SizeY']=30,['Groups']=0,['Id']=1005,['Z']=123939,['SizeZ']=30,},[4]={['X']=100671,['Color']=999999,['Pitch']=1.570971,['SizeX']=300,['Roll']=0,['Alpha']=1,['Y']=52006,['Yaw']=3.141593,['Contrast']=1,['EffectType']=413,['SizeY']=300,['Groups']=0,['Id']=1009,['Z']=122231,['SizeZ']=300,},[5]={['X']=106867,['Color']=999999,['Pitch']=0,['SizeX']=1000,['Roll']=0,['Alpha']=1,['Y']=52859,['Yaw']=0.785398,['Contrast']=1,['EffectType']=3,['SizeY']=1000,['Groups']=0,['Id']=1011,['Z']=121410,['SizeZ']=1000,},[6]={['X']=107683,['Color']=999999,['Pitch']=0,['MetaData']={['heraldrybkgcolor2']=193,['heraldrybkgcolor1']=264,['heraldrybkgstyle']=6,['heraldrycrestcat']=7,['heraldrycrestcolor']=209,['guildid']=734199,['heraldrybkgcat']=10,['heraldrycreststyle']=9,},['SizeX']=1000,['Yaw']=0.785398,['Alpha']=1,['Y']=34300,['Roll']=0,['Contrast']=1,['EffectType']=647,['SizeY']=1000,['Groups']=0,['Id']=1013,['Z']=122165,['SizeZ']=1000,},[7]={['X']=120306,['Color']=999999,['Pitch']=4.712564,['SizeX']=356,['Roll']=0,['Alpha']=1,['Y']=98030,['Yaw']=4.712389,['Contrast']=1,['EffectType']=6027,['SizeY']=228,['Groups']=0,['Id']=1014,['Z']=128325,['SizeZ']=228,},[8]={['X']=101941,['Color']=999999,['Pitch']=0,['MetaData']={['title']='The Shadow Gallery',},['SizeX']=100,['Yaw']=1.570796,['Alpha']=1,['Y']=52109,['Roll']=0,['Contrast']=1,['EffectType']=595,['SizeY']=100,['Groups']=0,['Id']=1019,['Z']=117276,['SizeZ']=100,},[9]={['X']=110268,['Color']=102439,['Pitch']=4.712564,['MetaData']={['title']='The Exarch\\'s Ledger',['message']='To Do:\\n\\n- Clean out the bank.\\n\\n- Check up on Vaninel.\\n\\n- Finish dissertation.\\n\\n- Plan next hunt.\\n\\n- Throw trash into lava.\\n\\n- Make lesson plan for Lavandir College.\\n\\n- Feed Loretta.',},['SizeX']=26.456456,['Yaw']=0,['Alpha']=1,['Y']=33691,['Roll']=0,['Contrast']=1,['EffectType']=8503,['SizeY']=30,['Groups']=0,['Id']=1020,['Z']=124721,['SizeZ']=30,},[10]={['X']=106114,['Color']=102439,['Pitch']=4.712564,['MetaData']={['title']='Vampire\\'s Journal',['message']='Last Entry\\n\\nRada al-Saran has fallen. The Gray Host is in disarray. We have no leader, and many are struggling for power. The exarchs and pentarchs are all either dead or gone. We are a snake without its head. The one that seems to have the most influence over us is Feldulf Blood-Bather. I suspect he will be our next leader. He says he will finish what Rada started. Whether that is true, I am unsure. But I make my way to Arkthzand to follow in his leadership.',},['SizeX']=26.456456,['Yaw']=4.014257,['Alpha']=1,['Y']=33678,['Roll']=0,['Contrast']=1,['EffectType']=8501,['SizeY']=30,['Groups']=0,['Id']=1035,['Z']=118242,['SizeZ']=30,},[11]={['X']=105952,['Color']=102439,['Pitch']=4.799655,['MetaData']={['title']='Anthotis Letter',['message']='Kin,\\n\\nLure the Black Star Coven into the silver mine. Make sure they are all there. Then, wait for the perfect time to strike. Make sure none survive, especially the Dunmer. I want to see them off the sands for good. Once that is done, report back to Hilsur. We will make sure no trace of Black Star remains.',},['SizeX']=26.456456,['Yaw']=4.886922,['Alpha']=1,['Y']=33650,['Roll']=0,['Contrast']=1,['EffectType']=8501,['SizeY']=30,['Groups']=0,['Id']=1036,['Z']=118422,['SizeZ']=30,},[12]={['X']=120876,['Color']=102439,['Pitch']=4.712564,['MetaData']={['title']='The Cheddar Massacre of Resdayn',['message']='25th of Morning Star\\n\\nGo to the Star Haven Adeptorium and have a dance party with my friends! I\\'m sure you all can bust out some choice dance moves. Just don\\'t get too hot, Elsweyr is already plenty hot! Haha!\\n\\n28th of Morning Star\\n\\nMeet me in Knightsgrave. I have some remodeling to do!\\n\\n1st of Sun\\'s Dawn\\n\\nI really hate the color yellow. Especially when it\\'s a bright yellow. And ESPECIALLY when it\\'s a bright yellow from a light! That\\'s why I don\\'t own candles. Anyways, head to Strastnoc\\'s Landing. I promise it\\'s related.\\n\\n\\n\\n4th of Sun\\'s Dawn\\n\\nMy cats haven\\'t been fed in a while. Could you do that for me? They stay in the Underroot, in the place you all call Greenshade. Their food should be there already, you just need to feed it to them. Watch out for snakes!\\n\\n8th of Sun\\'s Dawn\\n\\nI need you to go Eldbjorg\\'s Hideaway and find my cheese. I misplaced it when I was helping Eldbjorg make a new sword. He\\'s dead now.\\n\\n11th of Sun\\'s Dawn\\n\\nThe last game! Hee-hoo! Go to the Pillar of the Singing Sun and have another dance party with my friends. It\\'ll be smashing!',},['SizeX']=26.456456,['Yaw']=1.570796,['Alpha']=1,['Y']=98020,['Roll']=0,['Contrast']=1,['EffectType']=8503,['SizeY']=30,['Groups']=0,['Id']=1037,['Z']=127629,['SizeZ']=30,},[13]={['X']=117433,['Color']=999999,['Pitch']=4.712564,['SizeX']=296,['Roll']=0,['Alpha']=1,['Y']=50041,['Yaw']=3.926991,['Contrast']=1,['EffectType']=6026,['SizeY']=188,['Groups']=0,['Id']=1038,['Z']=132259,['SizeZ']=188,},},['HouseId']=79,['World']='na',['Version']='16.0.9',['TS']=1613503587,},},}"
